import React,{useState,useEffect}from 'react'
import axios from 'axios'

export default function AllTimeTables(){

    const[timetables,setTimetables]=useState([])

    useEffect(()=>{
        axios.get("http://localhost:8070/timetable/")
        .then(res=>{
            console.log(res)
            setTimetables(res.data)
        })
        .catch(err=>{
            console.log(err)
        })
    })
    return(
        <div className="container">
            <h1>new</h1>
            <ul>
                {
                    timetables.map(timetable=>(<li key={timetable.subjectName}></li>))
                }
            </ul>
            <a href="/add">Back</a>
        </div>
    )
}
